  top: -100px; /* Hide the navbar 50 px outside of the top view */
  width: 100%; /* Full width */
  transition: top 0.3s; /* Transition effect when sliding down (and up) */
}

::selection {
  background: #7E00AD;
  color: #ffffff;
}

.add-shadow{
  border: #CACACA 0px 0px 1px 0px;
}
